  CONSTRAINT `pr_prestaciones_ibfk_3` FOREIGN KEY (`id_tipo_prestacion`) REFERENCES `pr_tipo_prestacion` (`id_tipo_prestacion`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

