/* Function  structure for function  `FN_ARTICULO` */

/*!50003 DROP FUNCTION IF EXISTS `FN_ARTICULO` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`farmacia`@`%` FUNCTION `FN_ARTICULO`(cadart VARCHAR(120),cadesubg VARCHAR(120)) RETURNS int(11)
BEGIN
	DECLARE LN_id INT;
	declare ln_id_sub int;
	set ln_id_sub = 0;
	
	-- set ln_id_sub = (SELECT sg.id_subgrupo FROM pr_subgrupos sg WHERE UPPER(REPLACE(sg.nombre,' ','')) = UPPER(REPLACE(cadesubg,' ','')));
	set ln_id_sub = (SELECT sg.id_subgrupo FROM pr_subgrupos sg WHERE sg.nombre = cadesubg);
	
	SELECT sp.id_articulo INTO LN_id
	FROM pr_articulo sp 
	-- WHERE UPPER(REPLACE(sp.nombre_articulo,' ','')) = UPPER(REPLACE(cadart,' ','')) AND sp.id_subgrupo = ln_id_sub;
	WHERE sp.nombre_articulo = cadart AND sp.id_subgrupo = ln_id_sub;
	RETURN LN_id;
    END */$$
DELIMITER ;

/* Function  structure for function  `FN_CONCAT_PRODUCT` */

/*!50003 DROP FUNCTION IF EXISTS `FN_CONCAT_PRODUCT` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`farmacia`@`%` FUNCTION `FN_CONCAT_PRODUCT`(id_art int ,id_subg int) RETURNS varchar(190) CHARSET latin1
BEGIN
	declare nombre varchar(190);
	DECLARE valor1 VARCHAR(190);
	DECLARE valor2 VARCHAR(190);
	set nombre = '';
	SELECT a.`nombre_articulo` into valor1 FROM `pr_articulo` a WHERE a.`id_articulo` = id_art;
	SELECT s.`nombre` into valor2 FROM `pr_subgrupos` s WHERE s.`id_subgrupo`= id_subg;
	
	set nombre = concat(valor1,' ',valor2);
	return nombre;
    END */$$
DELIMITER ;

/* Function  structure for function  `FN_SUBGRUPO` */

/*!50003 DROP FUNCTION IF EXISTS `FN_SUBGRUPO` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`farmacia`@`%` FUNCTION `FN_SUBGRUPO`(cadena1 VARCHAR(120)) RETURNS int(11)
BEGIN
	declare LN_id int;
	SELECT sp.`id_subgrupo` into LN_id
	FROM `pr_subgrupos` sp 
	WHERE UPPER(REPLACE(sp.`nombre`,' ','')) = UPPER(REPLACE(cadena1,' ',''));
	
	RETURN LN_id;
    END */$$
DELIMITER ;

