/* Procedure structure for procedure `crearTmp` */

/*!50003 DROP PROCEDURE IF EXISTS  `crearTmp` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`farmacia`@`%` PROCEDURE `crearTmp`()
BEGIN
    DECLARE nombre1 VARCHAR(500);
    DECLARE i int;
    declare total int;
    DECLARE cursor_i CURSOR FOR SELECT DISTINCT(medicina.`forma_farmaceutica`) FROM medicina WHERE medicina.`forma_farmaceutica` IS NOT NULL;
	set i=1;
	set total=0;
	SELECT COUNT(DISTINCT(medicina.`forma_farmaceutica`)) into total FROM medicina;
    open cursor_i;
    while i<= total do
    fetch cursor_i into nombre1;
    insert into `tmp_subgrupo`(tmp_subgrupo.`nombre`)values(nombre1);commit;
    end while;
    close cursor_i;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `crear_medicina_articulo` */

/*!50003 DROP PROCEDURE IF EXISTS  `crear_medicina_articulo` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `crear_medicina_articulo`()
BEGIN
	DECLARE subgrupo1 VARCHAR(500);
	declare articulo1 VARCHAR(500) ;
	declare idesubgrupo1 int;
    DECLARE id_sub1 INT;
    DECLARE lc_count INT;
    DECLARE i INT;
    DECLARE total INT;
    DECLARE cursor_i CURSOR FOR SELECT  DISTINCT( p.`forma_farmaceutica`), p.`name` , s.`id_subgrupo` FROM `medicina` p INNER JOIN `pr_subgrupos` s 
ON s.`nombre` = p.`forma_farmaceutica`
WHERE  p.`name` = ANY (SELECT  DISTINCT(k.`name`)FROM `medicina` k);
	SET lc_count=1;
	SET i=1;
	SET total=0;
	SELECT COUNT(*) FROM (SELECT  DISTINCT( p.`forma_farmaceutica`), p.`name` , s.`id_subgrupo` FROM `medicina` p INNER JOIN `pr_subgrupos` s 
ON s.`nombre` = p.`forma_farmaceutica`
WHERE  p.`name` = ANY (SELECT  DISTINCT(k.`name`)FROM `medicina` k)) AS subquery INTO total ;
    OPEN cursor_i;
    WHILE i<= total DO
    FETCH cursor_i INTO subgrupo1,articulo1,idesubgrupo1;
	    INSERT INTO `pr_articulo`( `id_grupo`,
						`id_subgrupo`,
						`nombre_articulo`,
						`estado`,
						`usuario_creacion`,
						fecha_creacion)
				VALUES (3,
					idesubgrupo1,
					articulo1,
					'A',
					'admin',
					SYSDATE());
					COMMIT;
	SET lc_count = lc_count+1;
    END WHILE;
    CLOSE cursor_i;
    END */$$
DELIMITER ;

