DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `crear_medicina_producto`()
BEGIN
    DECLARE camp1 int;
    DECLARE camp2 INT;
    DECLARE camp3 INT;
    DECLARE camp4 INT;
    DECLARE camp5 INT;
    declare camp6 varchar(999);
    DECLARE id1 INT;
    DECLARE done INT DEFAULT FALSE;
    DECLARE cursor_i CURSOR FOR  SELECT g.`id_grupo`,s.`id_subgrupo`, a.`id_articulo` ,p.`id_tipo_presentacion`,d.`id_tipo_medidas` , 
CONCAT  (me.`forma_farmaceutica`," ", me.`name`," En ",me.`presentacion comercial` ," De ", me.`concentracion`) AS producto
FROM `pr_medidas` m
JOIN `pr_articulo` a
ON m.`id_grupo` = a.`id_grupo` AND m.`id_subgrupo` = a.`id_subgrupo` AND m.`id_articulo` =  a.`id_articulo`
JOIN `pr_subgrupos` s
ON  a.`id_subgrupo` = s.`id_subgrupo`
JOIN `pr_grupos` g
ON a.`id_grupo` = g.`id_grupo` 
JOIN `pr_tipo_presentacion` p
ON m.`id_tipo_presentacion` = p.`id_tipo_presentacion`
JOIN `pr_tipo_medidas` d
ON m.`id_tipo_medidas` = d.`id_tipo_medidas` 
JOIN `medicina` me
ON me.`forma_farmaceutica` = s.`nombre` AND me.`name` = a.`nombre_articulo`  AND me.`presentacion comercial` = p.`nombre` AND me.`concentracion` = d.`nombre_tipo_medida`
 ;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	SET id1 = 1;
	OPEN cursor_i;
	read_loop: LOOP
	FETCH cursor_i INTO camp1,camp2,camp3,camp4,camp5,camp6;
	IF done = TRUE THEN
		LEAVE read_loop;
        END IF;
        INSERT INTO `pr_productos`(`id_empresa`,
				`id_grupo`,
				`id_subgrupo`,
				`id_articulo`,
				`id_tipo_presentacion`,
				`id_tipo_medidas`,
				`nombre_producto`,
				`estado`,
				`usuario_creacion`,
				`fecha_creacion`) 
			VALUES(1,
				camp1,
				camp2,
				camp3,
				camp4,
				camp5,
				camp6,
				'A',
				'admin',
				SYSDATE()); COMMIT;
	SET id1= id1+1;
        END LOOP read_loop;
	
	CLOSE cursor_i;
    END */$$
DELIMITER ;

